import React, { useEffect, useRef, useState } from 'react';
import { message } from 'antd';
import { observer } from 'mobx-react';
import ShapeMenu from '../../common/sidebar/ShapeMenu';
import RelationshipsStore from '../store/RelationshipsStore';
import i18n from '../locales';
import { Relationship, Instance } from '../types';
import { formatFrames } from '../utils';
import './Relationships.scss';

interface RelationshipsProps {
  readonly: boolean;
  currentFrame: number;
  instances: {[instanceId: string]: Instance};
  getInstanceLabel: (instance: Instance) => string;
}

const Relationships = ({ readonly, currentFrame, instances, getInstanceLabel }: RelationshipsProps) => {
  const copyingRelationship = useRef<Relationship | null>(null);
  const [activeKey, setActiveKey] = useState<Relationship | null>(null);
  const [menuVisible, setMenuVisible] = useState(false);
  const [menuPosition, setMenuPosition] = useState({ x: -1, y: -1 });

  useEffect(() => {
    setActiveKey(null);
    setMenuVisible(false);
  }, [currentFrame]);

  const handleRightClick = (e: React.MouseEvent, key?: Relationship) => {
    e.preventDefault();
    e.stopPropagation();
    if (key) {
      setActiveKey(key);
    }
    setMenuVisible(true);
    setMenuPosition({ x: e.clientX + 5, y: e.clientY + 5 });
  };

  const handleDelete = () => {
    if (activeKey) {
      RelationshipsStore.deleteRelationship(activeKey, currentFrame);
    }
  };

  const handleApply = () => {
    if (activeKey) {
      const { from, to } = activeKey;
      const fromInstance = instances[from];
      const toInstance = instances[to];
      const fromInstanceFrames = Object.keys(fromInstance.frames).map((i) => parseInt(i, 10)).filter((i) => i > currentFrame);
      const toInstanceFrames = new Set(Object.keys(toInstance.frames).map((i) => parseInt(i, 10)).filter((i) => i > currentFrame));
      const frames = fromInstanceFrames.filter((f) => toInstanceFrames.has(f));
      RelationshipsStore.addRelationshipToFrames(activeKey, frames);
      message.success(i18n.translate('RELATIONSHIP_APPLY_FRAMES', { values: { frames: formatFrames(frames) } }));
    }
  };

  const handleCopy = () => {
    if (activeKey) {
      copyingRelationship.current = { ...activeKey };
      message.success(i18n.translate('RELATIONSHIP_COPIED'));
    }
  };

  const handlePaste = () => {
    if (copyingRelationship.current) {
      const { from, to, relation } = copyingRelationship.current;
      if (RelationshipsStore.getRelationship(currentFrame, from, to, relation)) {
        message.error(i18n.translate('RELATIONSHIP_EXISTS'));
      } else if (instances[from] && instances[from].frames[currentFrame] && instances[to] && instances[to].frames[currentFrame]) {
        // instances exists
        RelationshipsStore.addRelationshipToFrames(copyingRelationship.current, [currentFrame]);
      } else {
        message.error(i18n.translate('RELATIONSHIP_NO_INSTANCE'));
      }
    }
  };

  const menuItems = [
    ...activeKey ? [
      { label: i18n.translate('COMMON_DELETE'), disabled: readonly, onClick: handleDelete },
      { label: i18n.translate('APPLY_TO_FOLLOWING_FRAMES'), disabled: readonly, onClick: handleApply },
      { label: i18n.translate('COMMON_COPY'), disabled: readonly, onClick: handleCopy },
    ] : [],
    { label: i18n.translate('COMMON_PASTE'), disabled: readonly || !copyingRelationship.current, onClick: handlePaste },
  ];
  return (
    <div
      style={{ height: '100%' }}
      onContextMenu={handleRightClick}
    >
      {RelationshipsStore.getRelationships(currentFrame).map(({ from, to, relation }) => (
        <div key={`${from}-${to}-${relation}`} style={{ padding: '8px 12px' }}>
          <div
            className="relationship-item"
            onContextMenu={(e) => handleRightClick(e, { from, to, relation })}
          >
            <div className="relationship-item__name">
              <div className="relationship-name">
                {relation}
              </div>
              <div className="relationship-line" />
              <div className="relationship-arrow" />
            </div>
            <div className="relationship-item__instances">
              <div>
                {getInstanceLabel(instances[from])}
              </div>
              <div className="relationship-border-line" />
              <div>
                {getInstanceLabel(instances[to])}
              </div>
            </div>
          </div>
        </div>
      ))}
      {menuVisible && (
        <ShapeMenu position={menuPosition} items={[menuItems]} onClose={() => setMenuVisible(false)} />
      )}
    </div>
  );
};

export default observer(Relationships);
